        public Sys_Users GetUserByUserName(string userName)
        {
            Sys_Users user = new Sys_Users();
            var userEntry = aDHelper.GetUserDNByUserName(userName);
            if (userEntry != null)
            {
                user.UserName = userEntry.Properties["samaccountname"][0].ToString();
                user.FullName = userEntry.Properties["cn"][0].ToString();
                user.Gender = 1;
                user.Department = userEntry.Properties["department"][0] == null ? "" : userEntry.Properties["department"][0].ToString();
                user.Email = userEntry.Properties["mail"][0] == null ? "" : userEntry.Properties["mail"][0].ToString();

                var jobtitle = userEntry.Properties["title"][0] == null ? "" : userEntry.Properties["title"][0].ToString().ToLower();
                jobtitle = jobtitle.Contains("general manager") ? "vp" : jobtitle.Contains("director") ? "director" : jobtitle.Contains("supervisor") ? "supervisor" : jobtitle.Contains("manager") ? "manager" : "";
                user.JobTitle = jobtitle;

                var manager = userEntry.Properties["manager"][0] == null ? "" : userEntry.Properties["manager"][0].ToString();
                if (manager != "")
                {
                    manager = manager.Substring(manager.IndexOf("="), manager.IndexOf(",") - manager.IndexOf("="));
                    manager = manager.Substring(1, manager.Length - 1);
                }
                user.Report = manager;

                var userAccountControl = userEntry.Properties["userAccountControl"][0] == null ? "" : userEntry.Properties["userAccountControl"][0].ToString();
                int userActiveNum = Convert.ToInt32(userAccountControl);
                user.IsActive = (userActiveNum & 2) == 0;
                user.IsAdmin = false;
                user.EhiStratWorkDate = Convert.ToDateTime(userEntry.Properties["whencreated"][0] == null ? "" : userEntry.Properties["whencreated"][0].ToString());
                user.Phone = userEntry.Properties["telephonenumber"][0] == null ? "" : userEntry.Properties["telephonenumber"][0].ToString();

            }
            return user;
        }

        public List<AD_UserPwdNotify> GenerateADUser(string location)
        {
            logHelper.LogInfo($"start get {location} ADuser:" + DateTime.Now.ToString());

            var deleteUser = adUsersRepository.Where(i => i.Location == location).ToList();
            adUsersRepository.DeleteRange(deleteUser);

            List<AD_UserPwdNotify> adUsers = new List<AD_UserPwdNotify>();
            var needNotifyUsers = new List<AD_UserPwdNotify>();
            var maxAge = aDHelper.GetMaxAge();

            string key = "5ehealth";
            var domain = configuration.GetSection("ADSetting:Domain").Value.ToString();
            var admin = configuration.GetSection("ADSetting:User").Value.ToString();
            var adPassword = EncryptHelper.DESDecrypt(configuration.GetSection("ADSetting:Password").Value, key, key);
            try
            {
                var results = aDHelper.GetUserSearchByLocation(location);

                foreach (var searchResults in results)
                {
                    foreach (SearchResult result in searchResults)
                    {

                        var userEntry = result.GetDirectoryEntry();
                        //user.FullName = userEntry.Properties["cn"].Value.ToString();
                        if (userEntry.Properties["department"].Value == null || userEntry.Properties["co"].Value == null || userEntry.Properties["mail"].Value == null)
                            continue;

                        //logHelper.LogInfo(result.ToJson());

                        AD_UserPwdNotify adUser = new();
                        adUser.Location = location;
                        adUser.UserId = userEntry.Properties["samaccountname"].Value.ToString();
                        adUser.Department = userEntry.Properties["department"].Value == null ? "" : userEntry.Properties["department"].Value.ToString();
                        adUser.Email = userEntry.Properties["mail"].Value == null ? "" : userEntry.Properties["mail"].Value.ToString();

                        using (var content = new PrincipalContext(ContextType.Domain, domain, admin, adPassword))
                        {
                            UserPrincipal user = UserPrincipal.FindByIdentity(content, IdentityType.SamAccountName, adUser.UserId);
                            if (user != null)
                            {
                                adUser.ExpiredDate = user.LastPasswordSet.Value.AddDays(maxAge);// DateTime.Parse(userEntry.InvokeGet("PasswordExpirationDate").ToString());
                                adUser.PwdLastSetDate = user.LastPasswordSet;
                            }
                        };

                        #region //
                        // userEntry.Properties["co"].Value == null ? location : userEntry.Properties["co"].Value.ToString();

                        //var userAccountControl = userEntry.Properties["userAccountControl"].Value == null ? "0" : userEntry.Properties["userAccountControl"].Value.ToString();
                        //int userActiveNum = Convert.ToInt32(userAccountControl);
                        //user.IsActive = (userActiveNum & 2) == 0;

                        //ActiveDs.IADsUser nativeDeUser = (ActiveDs.IADsUser)userEntry.NativeObject;
                        //var passwordExpirationDate = nativeDeUser.PasswordExpirationDate;
                        #endregion
                        //long value = 0;
                        //value = (result.Properties["pwdlastset"][0] as long?).GetValueOrDefault();
                        //DateTime pwdLastSet = DateTime.FromFileTimeUtc(value);
                        //var passwordExpirationDate = pwdLastSet.AddDays(maxAge);
                        //adUser.ExpiredDate = passwordExpirationDate;// DateTime.Parse(userEntry.InvokeGet("PasswordExpirationDate").ToString());
                        //adUser.PwdLastSetDate = pwdLastSet;
                        adUsers.Add(adUser);

                    }
                }

                adUsersRepository.AddRange(adUsers);
                logHelper.LogInfo("end get ADuser:" + DateTime.Now.ToString() + $" Get {location + " "} {adUsers.Count} users");

                foreach (var user in adUsers)
                {
                    var exTime = user.ExpiredDate;
                    var tDay = (Convert.ToDateTime(user.ExpiredDate) - DateTime.Now).TotalDays;
                    tDay = Math.Round(tDay);
                    var notityDay = configuration.GetSection("ADSetting:ExpireDayNotify").GetChildren().Select(i => Convert.ToDouble(i.Value)).ToArray();
                    if (notityDay.Contains(tDay))
                    {
                        needNotifyUsers.Add(user);
                    }
                }
                return needNotifyUsers;
            }
            catch (Exception ex)
            {
                logHelper.LogError("getADuser error:" + ex.ToString());
                //return adUsers
                return needNotifyUsers;
            }


        }

        public void SendMail(List<AD_UserPwdNotify> users)
